import React from 'react';
import ReactDOM from 'react-dom';
import Hello_sir from './Hello-sir';
import {add,sub,mul,div} from './Calc-app';

ReactDOM.render(

   <>
<ul>
<li>addition is {add(3,4)} </li>
<li>substraction is{sub(4,5)} </li>
<li>Multiplication is{mul(120,200)} </li>
<li>division is {div(4,5)} </li>
</ul>
</>,



document.getElementById("root")

)
